import React from "react";
import "./TopNavbar.css";

const TopNavbar = () => {
  return (
    <div className="top-navbar">
      <ul>
        <li>India's Leading Online Shopping Destination</li>
        <li>Our Blog</li>
        <li>Help Center</li>
        <li>Sell On Snapdeal</li>
        <li>Download App</li>
      </ul>
    </div>
  );
};

export default TopNavbar;
